    {
     "type": "html",
     "name": "question3",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">We are currently looking for volunteers for a research study to learn more about the development of children as they grow from before birth to about 10 years of age. This is a nationwide study that will be the first large effort to look at how a child’s brain grows and develops in the early years of life and how the child’s environment influences that development. The study plans to enroll about 7,500 pregnant persons and their infants/children; about 300 will be enrolled from the Boston area.</p>"
    },
    {
     "type": "html",
     "name": "question4",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Would you like to hear more about the study?</p>"
    },
    {
     "type": "radiogroup",
     "name": "hearAboutStudy",
     "startWithNewLine": false,
     "titleLocation": "hidden",
